import React, { useState } from 'react';

import './creador-pizza.styles.scss';

interface Ingrediente {
	nombre: string;
	precio: number;
}

type Ingredientes = Ingrediente[];

const estadoIncial: Ingredientes = [
	{
		nombre: 'masa',
		precio: 10000,
	},
];

const CreadorPizza: React.FC = () => {
	const [ingredientes, setIngredientes] = useState(estadoIncial);
	return (
		<div>
			<h1>Creador de Pizza</h1>
		</div>
	);
};

export default CreadorPizza;
